import React, { Component } from 'react';
import {Link} from 'react-router-dom'

class Navbar extends Component {
    render() {
        return (
            <nav className="navbar-nav navbar-dark ">
            <Link to="/">
            <img src="ghar.svg" alt="store" className=""></img>
            </Link>
            <ul><li>product</li></ul>
            </nav>
        );
    }
}

export default Navbar;
